<!DOCTYPE html>
<html lang="zh-CN">
<head>
    <meta charset="UTF-8">
    <title>登录页面</title>
    <style>
        body {
            font-family: 'Arial', sans-serif;
            margin: 0;
            padding: 0;
            height: 100vh;
            display: flex;
            justify-content: center;
            align-items: center;
            background: linear-gradient(to right, #ff7e5f, #feb47b); /* 暖色调渐变背景 */
        }

        .login-container {
            width: 500px;
            background-color: #ffcc00; /* 温暖的米色背景 */
            padding: 20px;
            border-radius: 8px;
            box-shadow: 0 4px 8px rgba(0, 0, 0, 0.1);
            display: flex;
            flex-direction: column;
            align-items: center;
        }

        #loginForm {
            width: 60%;
        }

        h2 {
            color: #333; /* 更深的颜色以提高对比度 */
            text-align: center;
            margin-bottom: 20px;
        }

        .form-group {
            width: 100%;
            display: flex;
            flex-direction: column;
            margin-bottom: 20px;
        }

        label {
            color: #555; /* 柔和的颜色 */
            margin-bottom: 5px;
        }

        input[type="text"],
        input[type="password"] {
            padding: 10px;
            border: 1px solid #ddd;
            border-radius: 4px;
            margin-bottom: 10px;
            background-color: #fff; /* 输入框背景色 */
        }

        button {
            width: 100%;
            padding: 10px;
            background-color: #ff9f43; /* 暖色调按钮 */
            border: none;
            border-radius: 4px;
            color: #fff;
            font-size: 16px;
            cursor: pointer;
            transition: background-color 0.3s ease;
        }

        button:hover {
            background-color: #ff8c33; /* 按钮悬停效果 */
        }

        /* 底部文本样式 */
        .footer-text {
            position: absolute; /* 绝对定位 */
            bottom: 0; /* 底部对齐 */
            width: 100%; /* 宽度占满整个容器 */
            text-align: center;
            /*padding: 10px;*/
            /*background-color: #f5f5f5; !* 底部背景颜色 *!*/
            color: #666; /* 文字颜色 */
        }
    </style>
    <script src="https://ajax.googleapis.com/ajax/libs/jquery/3.5.1/jquery.min.js"></script>
</head>
<body>
<div class="login-container">
    <h2>登录</h2>
    <form id="loginForm" action="https://github.com/JSREI/jQuery-hook?tab=readme-ov-file" method="get">
        <div class="form-group">
            <label for="username">用户名:</label>
            <input type="text" id="username" name="username" required>
        </div>
        <div class="form-group">
            <label for="password">密码:</label>
            <input type="password" id="password" name="password" required>
        </div>
        <button type="button">登录</button>
    </form>
</div>
